import '../assets/styles/bg.scss';

const BubblesBackground = () => {
    return (
        <div class="bubbles">
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
            <div class="bubble"><h1 style={{color:'#fff'}}>&#8377;</h1></div>
        </div>
    )
}

export default BubblesBackground;
